'use strict';

angular.module('listings').controller('ListingGalleryModalController', [
    '$uibModalInstance',
    'Listing',
    'listingId',
    function($uibModalInstance, Listing, listingId) {

        var self = this;

        self.listing = Listing.get({listingId: listingId, fields: 'pictures'});


    }
]);
